    applyNoise= (value) => {
        return value += (Math.random() - .5) *.000000000001
    }

    multiVariateNormal = (model,index,observation) => {
        let covar = math.matrix(model[index]["covar"]);
        let mean = math.matrix(model[index]["mean"]);
        let x = math.matrix(observation);

        let offset = math.subtract(x,mean);
        let offsetTranspose = math.transpose(offset);
        let covarInverse = math.inv(covar);
        let k = observation.length;

        expTerm = math.multiply(-.5, offsetTranspose , covarInverse, offset);
        numerator = math.exp(expTerm);
        covDet = math.det(math.map(covar, applyNoise));
        denomCoefficient = math.pow(math.multiply(2, math.pi),k);
        denominator = math.sqrt(denomCoefficient * covDet);
        console.log([index, numerator, denominator])
        return numerator / denominator;
    }

        let features = [];
        // Getting 7x7 matrix features
        for(let i = 0; i < 7; i++) {
            for(let j = 0; j < 7; j++) {
                let element = 0;
                for(let x = 0; x < 4; x++) {
                    for(let y = 0; y < 4; y++) {
                        element = element + values[i+x][j+y];
                    }
                }
                features.push(element/16);
            }
        }
        // Getting 4x4 matrix features
        for(let i = 0; i < 4; i++) {
            for(let j = 0; j < 4; j++) {
                let element = 0;
                for(let x = 0; x < 7; x++) {
                    for(let y = 0; y < 7; y++) {
                        element = element + values[i+x][j+y];
                    }
                }
                features.push(element/49);
            }
        }
        return features
    }

            ctx.putImageData( pixelImage,x, y);

        }
